import React from 'react';

function App() {
  return (
    <div className="min-h-screen bg-gray-900 flex items-center justify-center">
      <div className="text-center">
        <h1 className="text-white text-6xl font-bold mb-4">Portfolio Website</h1>
        <p className="text-gray-300 text-xl">Your portfolio is working!</p>
        <div className="mt-8">
          <button className="bg-blue-600 hover:bg-blue-700 text-white font-bold py-3 px-6 rounded-lg mr-4">
            View Projects
          </button>
          <button className="bg-transparent border-2 border-white text-white font-bold py-3 px-6 rounded-lg hover:bg-white hover:text-gray-900">
            Contact Me
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
